func getTrees(right int, down int, input [][]string) int {
    i := 0
    j := 0

    tree := 0

    for {
        if (input [i][j] == "#") {
            tree++
        }
        i += down
        j += right

        j = j % len(input[0])

        if (i >= len(input)) {
            break;
        }
    }

    return tree
}
